function T_ReGen = ReGen(PRND,T,RPM)
if PRND==4,
    if T < 0,
        if RPM < 1500,
            T_ReGen = -(220/1500)*RPM;
        else
            T_ReGen = T;
        end
    else
        T_ReGen = T;
    end
elseif PRND==2,
    if T < 0,
        if RPM < 1500,
            T_ReGen = -(220/1500)*RPM;
        else
            T_ReGen = T;
        end
    else
        T_ReGen = T;
    end
else
   T_ReGen = 0; 
end

